    const { myName, description, showSmallPic, smallPic, backPic } = attributes;

    const handleShowSmallPicChanege = (checked) => {
        if (!checked) {
            changeTempPageChildAttributes({
                showSmallPic: checked,
                smallPic: ''
            })
        } else {
            changeTempPageChildAttributes({
                showSmallPic: checked,
                smallPic: smallPic
